var $bm_rt;
var amp, freq, decay, n, t, v, oscillation;
amp = 0.02;
freq = 2;
$bm_rt = decay = 5;
if (numKeys == 0) {
    $bm_rt = value;
} else {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time)
        n--;
    if (n == 0) {
        $bm_rt = value;
    } else {
        t = $bm_sub(time, key(n).time);
        v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
        oscillation = $bm_div(Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI)), Math.exp($bm_mul(decay, t)));
        $bm_rt = $bm_sum(value, $bm_mul($bm_mul(v, amp), oscillation));
    }
}

